import * as React from 'react';
import { View, StyleSheet, Button, Platform, Text } from 'react-native';
import * as Print from 'expo-print';
// import { shareAsync } from 'expo-sharing';


export const PrintButton = ({ data, tableHeader, printTitle, pageNo, type }) => {
  const [selectedPrinter, setSelectedPrinter] = React.useState();
  const [tableData, setTableData] = React.useState(data);
  const asset = '';
  const html = `
    <html>
    <head>
    <style>
    table{
      border:1px solid black;
      width:100%;
    }
    table th, table td{
      border:1px solid black;
      text-align:center;
    }
    .img{
      text-align:center;
      margin:0 auto;
    }
    .title{
      text-align:center;
      color:black;
      margin-bottom:20px;
    }
    </style>
    </head>
      <body>
      <div class="img">
      <img
      src="data:image/png;base64,${asset}"
      style="width:100px;height:50px;" />
      </div>

      <div class="title">
      <h2>${printTitle}</h2>
      ${pageNo != null ? `<p>Page Number : ${pageNo + 1}</p>` : ''}
      <p>Printed on : ${new Date().toLocaleString("en-NZ")}</p>
      </div>


        <table>
          <thead>

          <tr>
          ${tableHeader !== null ?
      (
        tableHeader.map((item) => `
                        <th>${item}</th>
                    `
        )
          .join('')
      ) : ''
    }
          
          </tr>
          </thead>
          <tbody>
            ${tableData !== null ?
      (
        tableData.map((item) => `
                <tr>

                  ${type === 1 ?
            `<td>${item.C}</td>
            <td>${item.D}</td>
            <td>${item.T}</td>`
            : (
              type === 0 ?
                `<td>${item.I}</td>
                    <td>${item.M}</td>
                    <td>${item.E}</td>
                    <td>${item.D}</td>
                    <td>${item.T}</td>`
                :

                (
                  type === 4 ?
                    `<td>${item.L}</td>
                      <td>${item.P}</td>
                      <td>${item.A}</td>
                      <td>${item.X}</td>
                      <td>${item.H}</td>
                      <td>${item.B}</td>
                      <td>${item.D}</td>
                      <td>${item.R}</td>
                      <td>${item.N}</td>
                      <td>${item.S}</td>`
                    : (
                      type === 2 ?
                        `<td>${item.F}</td>
                        <td>${item.D}</td>
                        <td>${item.T}</td>`
                        : ``
                    )
                )

            )
          }
                  
                </tr>
              `
        )
          .join('')
      ) : ''
    }
          </tbody>
        </table>
      </body>
    </html>
  `;

  const print = async () => {
    await Print.printAsync({
      html,
      orientation: type === 4 ? 'landscape' : 'potrait',
      base64: false,
      printerUrl: selectedPrinter?.url, // iOS only
    });
  };

  // const printToFile = async () => {
  //   // On iOS/android prints the given html. On web prints the HTML from the current page.
  //   const { uri } = await Print.printToFileAsync({ html });
  //   console.log('File has been saved to:', uri);
  //   await shareAsync(uri, { UTI: '.pdf', mimeType: 'application/pdf' });
  // };

  const selectPrinter = async () => {
    const printer = await Print.selectPrinterAsync(); // iOS only
    setSelectedPrinter(printer);
  };

  return (
    <View style={styles.container}>
      <Button title="Print" onPress={print} color="blue" />
      <View style={styles.spacer} />
      {Platform.OS === 'ios' && (
        <>
          <View style={styles.spacer} />
          <Button title="Select printer" onPress={selectPrinter} />
          <View style={styles.spacer} />
          {selectedPrinter ? (
            <Text style={styles.printer}>{`Selected printer: ${selectedPrinter.name}`}</Text>
          ) : undefined}
        </>
      )}
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    // flex: 1,
    // justifyContent: 'center',
    backgroundColor: '#ecf0f1',
    flexDirection: 'column',
    padding: 8,
  },
  spacer: {
    height: 8,
  },
  printer: {
    textAlign: 'center',
  },
});
